import React from 'react';
import {DropdownMenu, DropdownToggle, Dropdown} from 'reactstrap';

class InputAutoSuggestion extends React.Component {
  constructor() {
    super();
    this.state = {
      value: '',
      dropdownOpen: true
    };
  }

  render(){

    return(
      <Dropdown isOpen={this.state.dropdownOpen}>
        <DropdownToggle
        tag={"Input"}>
        </DropdownToggle>
        <DropdownMenu>
          <div>hi</div>
        </DropdownMenu>
      </Dropdown>
    );
  }
}

export default InputAutoSuggestion;
